class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        def find_max3(arr):
            i1, i2, i3 = -1, -1, -1
            for i in range(len(arr)):
                if i1 == -1 or arr[i] > arr[i1]:
                    i3 = i2
                    i2 = i1
                    i1 = i
                elif i2 == -1 or arr[i] > arr[i2]:
                    i3 = i2
                    i2 = i
                elif i3 == -1 or arr[i] > arr[i3]:
                    i3 = i
            return i1, i2, i3

        m, n = len(board), len(board[0])
        res = 0
        max3_in_rows = []
        for i in range(m):
            max3_in_rows.append(find_max3(board[i]))

        res = -inf
        for i1 in range(m):
            for i2 in range(i1 + 1, m):
                for i3 in range(i2 + 1, m):
                    for j1 in max3_in_rows[i1]:
                        for j2 in max3_in_rows[i2]:
                            if j1 == j2:
                                continue
                            for j3 in max3_in_rows[i3]:
                                if j1 == j3 or j2 == j3:
                                    continue
                                res = max(res, board[i1][j1] + board[i2][j2] + board[i3][j3])

        return res
